import React from "react";
import './style.css';
import Card from '../Card';

const BlogPost = props => {
    return (
        <div className = "blogPostContainer">
            <Card>
                <span>Featured</span>
                <h1></h1>
            </Card>
        </div>
    )
};

export default BlogPost;
